import React from 'react';

import weatherIcon from '../../../assets/image/weatherIcon.png'
import SearchInput from '../searchInput/SearchInput';

const Header = () => {
  return (
    <div style={{display: 'flex'}}>
      <img 
        src={weatherIcon}
        alt='test'
      />
      <h1>Weather App</h1>
      <SearchInput />

    </div>
  );
};

export default Header;
